import React from "react";

export default function Nav() {
  return (
    <div>
      <ul class="nav">
        <li class="nav-item justify-content-left">Link</li>
        <li class="nav-item justify-content-center">Link</li>
        <li class="nav-item justify-content-right">Link</li>
      </ul>
    </div>
  );
}
